import React, { useState } from "react";
import Icon from "react-native-vector-icons/AntDesign" 
import { SafeAreaView, View, Text, ScrollView, StyleSheet, TouchableOpacity, TextInput, Pressable, Modal } from "react-native";
import {  
    FirstView6,
    BigText5,
    SecondView6,
    PayText
} from "../componenets/fintech6Style"

import { PhotoView, Quantity, QtyText } from "../componenets/fintech4Style";
import { 
    PhotoView1, 
    Quantity1, 
    QtyText1,
    FirstView5,
    BigText4,
    SecondView4,
    ButtonText1
 } from "../componenets/fintech5Style";
export default function Fintech6({navigation}){
    const [modalVisible, setModalVisible] = useState(false);
    const [modalVisible1, setModalVisible1] = useState(false);
    return(
        <SafeAreaView style={styles.fintech6container}>
            <Modal
            animationType="fade"
            visible={modalVisible}
            onRequestClose={() => {
                setModalVisible(!modalVisible);
              }}
            >
                <View style={styles.popup1}>
                <View style={styles.mar}>
                <FirstView5>
                <TouchableOpacity style={styles.back3} onPress={()=>setModalVisible(!modalVisible)}>
                   <Icon size={20} color="#C3AD60" name="back" style={styles.pad4}/> 
                    </TouchableOpacity>
                   <BigText4 style={styles.pad4}>Procurement</BigText4>
                </FirstView5>
                </View>
                
                </View>
            </Modal>
            <Modal
            animationType="fade"
            visible={modalVisible1}
            onRequestClose={() => {
                setModalVisible1(!modalVisible1);
              }}
            >
                <View style={styles.popup2}>

                </View>
            </Modal>
            <ScrollView>
                <FirstView6>
                <TouchableOpacity style={styles.back4} onPress={()=>navigation.navigate("Fintech1")}>
                   <Icon size={20} color="#C3AD60" name="back" style={styles.pad5}/> 
                    </TouchableOpacity>
                   <BigText5 style={styles.pad5}>Submitted Orders</BigText5>
                </FirstView6>
                <SecondView6>
                <Pressable onPress={() => setModalVisible(true)}>
                <PhotoView1>
                    <Quantity1><QtyText1>Qty: 1</QtyText1><Icon name="caretdown" size={6} color="#fff"/></Quantity1>
                    <TextInput style={styles.link} value="link"></TextInput>
                </PhotoView1>
                </Pressable>
                <View style={styles.move}>
                <Pressable onPress={() => setModalVisible1(true)}>
                <PhotoView source={require('../../../../assets/pro.png')}>
                    <Quantity><QtyText>Qty: 1</QtyText><Icon name="caretdown" size={6} color="#fff"/></Quantity>
                </PhotoView>
                </Pressable>
                </View>
                <TouchableOpacity style={styles.paybtn}>
                    <PayText>Pay All</PayText>
                </TouchableOpacity>
                </SecondView6>
            </ScrollView>
        </SafeAreaView>
)};

const styles = StyleSheet.create({
    fintech6container: {
        backgroundColor: "#000",
        paddingTop: 25,
        flex: 1,
    },
    back4: {
        padding: 10,
    },
    pad5: {
        paddingLeft: 40,
    },
    link: {
        height: 64,
        width: 340,
        backgroundColor: "#4E4E4E",
        color:"#fff",
        borderBottomLeftRadius: 20,
        borderBottomRightRadius: 20,
        position: "absolute",
        left: 0,
        top: 156,
        paddingLeft: 25,
    },
    move: {
        marginTop: 32,
    },
    paybtn: {
        height: 48,
        width: 348,
        borderRadius: 100,
        alignItems: "center",
        justifyContent: "center",
        borderWidth: 1,
        borderColor: "#C3AD60",
        marginTop:64,
    },
    popup1: {
        backgroundColor: "#000",
        flex: 1,
    },
    popup2: {
        backgroundColor: "#000",
        flex: 1,
    },
    back3: {
        padding: 10,
    },
    pad4: {
        paddingLeft: 40,
    },
    mar: {
        marginTop: 55,
    }
})
